import React from 'react'

import useAdminUsers from '@/hooks/user/useAdminUsers'
import usePostChangeUser from '@/hooks/user/usePostChangeUser'

const UserPage = () => {
  const { data: users } = useAdminUsers()
  const { mutateAsync: changeUser } = usePostChangeUser()

  return (
    <div>
      {users?.map((user) => (
        <div
          key={user.id}
          style={{ display: 'flex', justifyContent: 'space-between', alignItems: 'center', padding: '10px', borderBottom: '1px solid #ddd' }}>
          {/* 유저 정보 표시 */}
          <div>
            <p>ID: {user.id}</p>
            <p>Nickname: {user.nickname}</p>
            <p>Phone Number: {user.phoneNumber}</p>
            <p>Description: {user.description}</p>
          </div>

          {/* 버튼 추가 */}
          <button
            onClick={async () => {
              try {
                await changeUser({ userId: user.id })
                alert('성공')
              } catch (e) {
                alert('에러')
              }
            }}
            style={{ padding: '8px 16px', cursor: 'pointer' }}>
            Change User
          </button>
        </div>
      ))}
    </div>
  )
}

export default UserPage
